$templateCache.put("libs/amcharts/plugins/animate/examples/xy.html","<!DOCTYPE html><html><head><meta charset=\"utf-8\"><style>html, body {\n				width: 100%;\n				height: 100%;\n				margin: 0px;\n			}\n\n			#chartdiv {\n				width: 100%;\n				height: 100%;\n			}</style></head><body><script src=\"http://www.amcharts.com/lib/3/amcharts.js\"></script><script src=\"http://www.amcharts.com/lib/3/xy.js\"></script><script src=\"http://www.amcharts.com/lib/3/themes/light.js\"></script><script src=\"../animate.js\"></script><div id=\"chartdiv\"></div><script>var chart = AmCharts.makeChart(\"chartdiv\", {\n				\"type\": \"xy\",\n				\"theme\": \"light\",\n				\"dataProvider\": generateChartData(),\n				\"valueAxes\": [{\n					\"position\": \"left\",\n					\"minimum\": 0,\n					\"maximum\": 100\n				}, {\n					\"position\": \"bottom\",\n					\"minimum\": 0,\n					\"maximum\": 100\n				}],\n				\"graphs\": [{\n					\"bullet\": \"round\",\n					\"xField\": \"x\",\n					\"yField\": \"y\",\n					\"valueField\": \"value\",\n					\"alphaField\": \"alpha\"\n				}]\n			});\n\n\n			function generateChartData() {\n				var chartData = [];\n\n				for ( var i = 0; i < 50; i++ ) {\n					chartData.push( {\n						x: Math.floor(Math.random() * 100),\n						y: Math.floor(Math.random() * 100),\n						value: Math.floor(Math.random() * 100),\n						alpha: Math.random()\n					} );\n				}\n\n				return chartData;\n			}\n\n\n			function loop() {\n				var data = generateChartData();\n\n				chart.animateData(data, {\n					duration: 1000,\n					complete: function () {\n						setTimeout(loop, 2000);\n					}\n				});\n			}\n\n			chart.addListener(\"init\", function () {\n				setTimeout(loop, 1000);\n			});</script></body></html>");
