$templateCache.put("libs/amcharts/plugins/responsive/examples/serial3.html","<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"><meta name=\"viewport\" content=\"width=device-width,initial-scale=1,maximum-scale=1\"><title>amCharts Responsive Example</title><script src=\"http://www.amcharts.com/lib/3/amcharts.js\"></script><script src=\"http://www.amcharts.com/lib/3/serial.js\"></script><script src=\"../responsive.min.js\"></script><style>body, html {\n    height: 100%;\n    padding: 0;\n    margin: 0;\n  }</style><script>var chartData = [];\n    generateChartData();\n\n    var chart = AmCharts.makeChart(\"chartdiv\", {\n      \"type\": \"serial\",\n      \"dataProvider\": chartData,\n      \"categoryField\": \"date\",\n      \"categoryAxis\": {\n        \"parseDates\": true,\n        \"gridAlpha\": 0.15,\n        \"minorGridEnabled\": true,\n        \"axisColor\": \"#DADADA\"\n      },\n      \"valueAxes\": [{\n        \"axisAlpha\": 0.2,\n        \"id\": \"v1\"\n      }],\n      \"graphs\": [{\n        \"title\": \"red line\",\n        \"id\": \"g1\",\n        \"valueAxis\": \"v1\",\n        \"valueField\": \"visits\",\n        \"bullet\": \"round\",\n        \"bulletBorderColor\": \"#FFFFFF\",\n        \"bulletBorderAlpha\": 1,\n        \"lineThickness\": 2,\n        \"lineColor\": \"#b5030d\",\n        \"negativeLineColor\": \"#0352b5\",\n        \"balloonText\": \"[[category]]<br><b><span style=\'font-size:14px;\'>value: [[value]]</span></b>\"\n      }],\n      \"chartCursor\": {\n        \"fullWidth\": true,\n        \"cursorAlpha\": 0.1\n      },\n      \"chartScrollbar\": {\n        \"scrollbarHeight\": 40,\n        \"color\": \"#FFFFFF\",\n        \"autoGridCount\": true,\n        \"graph\": \"g1\"\n      },\n      \"mouseWheelZoomEnabled\": true,\n      \"responsive\": {\n        \"enabled\": true\n      }\n    });\n\n    chart.addListener(\"dataUpdated\", zoomChart);\n\n\n    // generate some random data, quite different range\n    function generateChartData() {\n      var firstDate = new Date();\n      firstDate.setDate(firstDate.getDate() - 500);\n\n      for (var i = 0; i < 500; i++) {\n        // we create date objects here. In your data, you can have date strings\n        // and then set format of your dates using chart.dataDateFormat property,\n        // however when possible, use date objects, as this will speed up chart rendering.\n        var newDate = new Date(firstDate);\n        newDate.setDate(newDate.getDate() + i);\n\n        var visits = Math.round(Math.random() * 40) - 20;\n\n        chartData.push({\n            date: newDate,\n            visits: visits\n        });\n      }\n    }\n\n    // this method is called when chart is first inited as we listen for \"dataUpdated\" event\n    function zoomChart() {\n      // different zoom methods can be used - zoomToIndexes, zoomToDates, zoomToCategoryValues\n      chart.zoomToIndexes(chartData.length - 40, chartData.length - 1);\n    }</script></head><body><div id=\"chartdiv\" style=\"width: 100%; height: 100%\"></div></body></html>");
$templateCache.put("libs/amcharts/plugins/responsive/examples/stock.html","<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"><meta name=\"viewport\" content=\"width=device-width,initial-scale=1,maximum-scale=1\"><title>amCharts Responsive Example</title><script src=\"http://www.amcharts.com/lib/3/amcharts.js\"></script><script src=\"http://www.amcharts.com/lib/3/serial.js\"></script><script src=\"http://www.amcharts.com/lib/3/amstock.js\"></script><script src=\"../responsive.min.js\"></script><style>body, html {\n      height: 100%;\n      padding: 0;\n      margin: 0;\n      font-family: Verdana;\n      font-size: 12px;\n    }</style><script>var chartData1 = [];\n    var chartData2 = [];\n    var chartData3 = [];\n    var chartData4 = [];\n\n    generateChartData();\n\n    function generateChartData() {\n      var firstDate = new Date();\n      firstDate.setDate( firstDate.getDate() - 500 );\n      firstDate.setHours( 0, 0, 0, 0 );\n\n      for ( var i = 0; i < 500; i++ ) {\n        var newDate = new Date( firstDate );\n        newDate.setDate( newDate.getDate() + i );\n\n        var a1 = Math.round( Math.random() * ( 40 + i ) ) + 100 + i;\n        var b1 = Math.round( Math.random() * ( 1000 + i ) ) + 500 + i * 2;\n\n        var a2 = Math.round( Math.random() * ( 100 + i ) ) + 200 + i;\n        var b2 = Math.round( Math.random() * ( 1000 + i ) ) + 600 + i * 2;\n\n        var a3 = Math.round( Math.random() * ( 100 + i ) ) + 200;\n        var b3 = Math.round( Math.random() * ( 1000 + i ) ) + 600 + i * 2;\n\n        var a4 = Math.round( Math.random() * ( 100 + i ) ) + 200 + i;\n        var b4 = Math.round( Math.random() * ( 100 + i ) ) + 600 + i;\n\n        chartData1.push( {\n          \"date\": newDate,\n          \"value\": a1,\n          \"volume\": b1\n        } );\n        chartData2.push( {\n          \"date\": newDate,\n          \"value\": a2,\n          \"volume\": b2\n        } );\n        chartData3.push( {\n          \"date\": newDate,\n          \"value\": a3,\n          \"volume\": b3\n        } );\n        chartData4.push( {\n          \"date\": newDate,\n          \"value\": a4,\n          \"volume\": b4\n        } );\n      }\n    }\n\n    var chart = AmCharts.makeChart( \"chartdiv\", {\n      \"type\": \"stock\",\n      \"theme\": \"none\",\n\n      \"dataSets\": [ {\n          \"title\": \"first data set\",\n          \"fieldMappings\": [ {\n            \"fromField\": \"value\",\n            \"toField\": \"value\"\n          }, {\n            \"fromField\": \"volume\",\n            \"toField\": \"volume\"\n          } ],\n          \"dataProvider\": chartData1,\n          \"categoryField\": \"date\"\n        },\n\n        {\n          \"title\": \"second data set\",\n          \"fieldMappings\": [ {\n            \"fromField\": \"value\",\n            \"toField\": \"value\"\n          }, {\n            \"fromField\": \"volume\",\n            \"toField\": \"volume\"\n          } ],\n          \"dataProvider\": chartData2,\n          \"categoryField\": \"date\"\n        },\n\n        {\n          \"title\": \"third data set\",\n          \"fieldMappings\": [ {\n            \"fromField\": \"value\",\n            \"toField\": \"value\"\n          }, {\n            \"fromField\": \"volume\",\n            \"toField\": \"volume\"\n          } ],\n          \"dataProvider\": chartData3,\n          \"categoryField\": \"date\"\n        },\n\n        {\n          \"title\": \"fourth data set\",\n          \"fieldMappings\": [ {\n            \"fromField\": \"value\",\n            \"toField\": \"value\"\n          }, {\n            \"fromField\": \"volume\",\n            \"toField\": \"volume\"\n          } ],\n          \"dataProvider\": chartData4,\n          \"categoryField\": \"date\"\n        }\n      ],\n\n      \"panels\": [ {\n          \"showCategoryAxis\": false,\n          \"title\": \"Value\",\n          \"percentHeight\": 70,\n          \"stockGraphs\": [ {\n            \"id\": \"g1\",\n            \"valueField\": \"value\",\n            \"comparable\": true,\n            \"compareField\": \"value\",\n            \"balloonText\": \"[[title]]:<b>[[value]]</b>\",\n            \"compareGraphBalloonText\": \"[[title]]:<b>[[value]]</b>\"\n          } ],\n          \"stockLegend\": {\n            \"periodValueTextComparing\": \"[[percents.value.close]]%\",\n            \"periodValueTextRegular\": \"[[value.close]]\"\n          }\n        },\n        {\n          \"title\": \"Volume\",\n          \"percentHeight\": 30,\n          \"stockGraphs\": [ {\n            \"valueField\": \"volume\",\n            \"type\": \"column\",\n            \"showBalloon\": false,\n            \"fillAlphas\": 1\n          } ],\n          \"stockLegend\": {\n            \"periodValueTextRegular\": \"[[value.close]]\"\n          }\n        }\n      ],\n\n      \"chartScrollbarSettings\": {\n        \"graph\": \"g1\"\n      },\n\n      \"chartCursorSettings\": {\n        \"valueBalloonsEnabled\": true,\n        \"fullWidth\": true,\n        \"cursorAlpha\": 0.1,\n        \"valueLineBalloonEnabled\": true,\n        \"valueLineEnabled\": true,\n        \"valueLineAlpha\": 0.5\n      },\n\n      \"periodSelector\": {\n        \"position\": \"left\",\n        \"periods\": [ {\n          \"period\": \"MM\",\n          \"selected\": true,\n          \"count\": 1,\n          \"label\": \"1 month\"\n        }, {\n          \"period\": \"YYYY\",\n          \"count\": 1,\n          \"label\": \"1 year\"\n        }, {\n          \"period\": \"YTD\",\n          \"label\": \"YTD\"\n        }, {\n          \"period\": \"MAX\",\n          \"label\": \"MAX\"\n        } ]\n      },\n\n      \"dataSetSelector\": {\n        \"position\": \"left\"\n      },\n\n      \"responsive\": {\n        \"enabled\": true\n      }\n    } );</script></head><body><div id=\"chartdiv\" style=\"width: 100%; height: 100%\"></div></body></html>");
