$templateCache.put("libs/ammaps/plugins/dataloader/examples/serial_with_dynamic_graphs.html","<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"><meta name=\"viewport\" content=\"width=device-width,initial-scale=1,maximum-scale=1\"><title>amCharts Data Loader Example</title><script src=\"http://www.amcharts.com/lib/3/amcharts.js\"></script><script src=\"http://www.amcharts.com/lib/3/serial.js\"></script><script src=\"../dataloader.min.js\"></script><style>body, html {\n      font-family: Verdana;\n      font-size: 12px;\n    }\n    #chartdiv {\n      width: 100%;\n      height: 500px;\n    }</style><script>var chart = AmCharts.makeChart(\"chartdiv\", {\n     \"type\": \"serial\",\n      \"dataLoader\": {\n        \"url\": \"data/serial.json\",\n        \"format\": \"json\",\n        \"showErrors\": true,\n        \"noStyles\": true,\n        \"async\": true,\n        \"load\": function( options, chart ) {\n          // Here the data is already loaded and set to the chart.\n          // We can iterate through it and add proper graphs\n          for ( var key in chart.dataProvider[ 0 ] ) {\n            if ( chart.dataProvider[ 0 ].hasOwnProperty( key ) && key != chart.categoryField ) {\n              var graph = new AmCharts.AmGraph();\n              graph.valueField = key;\n              graph.type = \"line\";\n              graph.title = key,\n              graph.lineThickness = 2;\n              chart.addGraph( graph );\n            }\n          }\n        }\n      },\n     \"rotate\": false,\n     \"marginTop\": 10,\n     \"categoryField\": \"year\",\n     \"categoryAxis\": {\n       \"gridAlpha\": 0.07,\n       \"axisColor\": \"#DADADA\",\n       \"startOnAxis\": false,\n       \"title\": \"Year\",\n       \"guides\": [{\n         \"category\": \"2001\",\n         \"lineColor\": \"#CC0000\",\n         \"lineAlpha\": 1,\n         \"dashLength\": 2,\n         \"inside\": true,\n         \"labelRotation\": 90,\n         \"label\": \"fines for speeding increased\"\n       }, {\n         \"category\": \"2007\",\n         \"lineColor\": \"#CC0000\",\n         \"lineAlpha\": 1,\n         \"dashLength\": 2,\n         \"inside\": true,\n         \"labelRotation\": 90,\n         \"label\": \"motorcycle fee introduced\"\n       }]\n     },\n     \"valueAxes\": [{\n       \"stackType\": \"regular\",\n       \"gridAlpha\": 0.07,\n       \"title\": \"Traffic incidents\"\n     }],\n     \"graphs\": [],\n     \"legend\": {\n       \"position\": \"bottom\",\n       \"valueText\": \"[[value]]\",\n       \"valueWidth\": 100,\n       \"valueAlign\": \"left\",\n       \"equalWidths\": false,\n       \"periodValueText\": \"total: [[value.sum]]\"\n     },\n     \"chartCursor\": {\n       \"cursorAlpha\": 0\n     },\n     \"chartScrollbar\": {\n       \"color\": \"FFFFFF\"\n     }\n\n    });</script></head><body><div id=\"chartdiv\"></div></body></html>");
